*
 * 页端透传服务端数据给客户端，用于记录月票动态信息
 * 服务端透传，获取接口：/andapi/monthticket/index
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<Object>}
 *
 * @example
 * const params = {
 *   mt1: `${Math.round(Date.now() / 1000)}`,
 *   mt2: 0,
 * };
 * libSQ.exec('save-ticket-info', {
 *   params: {
 *     // 服务端透传，获取接口：/andapi/monthticket/index
 *     monthTicketUpdateVersion: JSON.stringify(params),
 *   },
 * }).then((info) => {
 *   alert(`[save-ticket-info][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[save-ticket-info][error] ${JSON.stringify(err, null, 2)}`);
 * });
 *
 * @todo 可能有问题，待实测时再验证

